import React from 'react';
import {Link} from "react-router-dom";

function Header() {
    return (
        <header>
            <a href="" className="logo">Blogify.io</a>
            <nav>
                <Link href="/login">Login</Link>
                <Link href="">Register</Link>
            </nav>
        </header>
    );
}

export default Header;
